import React from "react";
import Card from "../../components/card/card";
import Grid from "@material-ui/core";

export default function Landing(){
    return (
        <Grid container>
            <Card question="STRANGERS OR NOT IS A GAME BASED OFF OF THE POPULAR CARD GAME, WE'RE NOT REALLY STRANGERS. IT IS A PURPOSE DRIVEN CARD GAME AND MOVEMENT ALL ABOUT EMPOWERING MEANINGFUL CONNECTIONS."/>
            <Card question="THREE CAREFULLY CRAFTED LEVELS OF QUESTIONS AND WILDCARDS WILL ALLOW YOU TO DEEPEN YOUR EXISTING RELATIONSHIP AND CREATE NEW ONES."/>
            <Card question="ORGANIZE A VIRTUAL CALL WITH WHOMEVER YOU'D LIKE TO PLAY WITH. ONE PLAYER CAN HAVE THE QUESTIONS UP FOR THE GROUP."/>
            <Card question="HAVE THE ONE PLAYER CHOOSE HOW MANY CARDS THEY WANT PER ROUND. THEN, THE PLAYER WILL HAVE THE CARD IN PLAY SHOWN ON THEIR SCREEN, SO THEY CAN READ THE QUESTION CARD TO THE REST OF THE GROUP."/>
            <Card question="GO AROUND LETTING EACH PLAYER ANSWER THE QUESTION BEFORE MOVING ON. USE THE ARROWS TO MOVE ON TO THE NEXT QUESTION OR TO LOOK BACK AT PREVIOUS QUESTIONS."/>
            <Card question="LEVEL 1 CARDS ARE PERCEPTION QUESTIONS. THIS LEVEL IS ABOUT GAINING PERSPECTIVE ON WHAT FIRST IMPRESSIONS WE GIVE OFF AND CHALLENGING THE ASUMPTIONS WE MAKE ABOUT OTHERS."/>
            <Card question="LEVEL 2 CARDS ARE CONNECTION QUESTIONS. THIS LEVEL IS ABOUT ASKING THE RARELY ASKED QUESTIONS AND CONNECTING ON A DEEPER LEVEL."/>
            <Card question="LEVEL 3 ARE REFLECTION QUESTIONS. THIS LEVEL IS THE TIME TO REFLECT ON YOUR GAME EXPERIENCE."/>
            <Card question="AT THE END OF THE GAME, THERE WILL BE A FINAL CARD. SEND YOUR PLAYERS A MESSAGE. OPEN ONLY ONCE YOU ALL HAVE LEFT THE CALL."/>
        </Grid>
    )
}
